postcontent:
I have a very RARE and super clean PAIR of Chris Reeve Shadow III's, custom built in June 2001 for my wife and I.  One was carried briefly by my wife and the other is unused.  Both are in excellent condition to include the custom made leather sheaths for each.  Both have been built with with a single cross guard option and are A2 steel.  I use a Shadow IV for every thing so never used my III.  No boxes, sorry, but I did manage to dig up one of the cards from when they were built.  Excellent Bushcraft or military use blades.  Super strong one piece construction, sharp, do your research.  I will put two links here for you to look at.  

Specs:
Model - Chris Reeve Shadow III;
Blade Length - 101mm (4"), non-reflective Kalgard® coating;
Blade Thickness - 4.5 mm (0.177");
Blade Width - 21.97mm (0.865");
Overall Length - 203mm (8");
Weight - 170g (6 oz.);
Steel - A2 Tool Steel hardened at 55-57 RC;
Warranty - Lifetime;

http://zknives.com/knives/fixed/crk/crkshdw3.shtml
http://www.donrearic.com/crshadow3.htm
Second link shows the construction of the knife.
